import React from 'react'

function AboutIntro() {
    return (
        <section>
            <div>
                <h1>About Us </h1>
                <p>
                Clockwise Technologies has grown to become a reliable ally in delivering critical, engineering projects to its valuable list of customers. With the ability to provide “all engineering” services in-house our company has the ability and track record of making the impossible possible and sometimes on unbelievably short timescales. </p>
            </div>
        </section>
    )
}



export default AboutIntro
